text:
@GPiftw Bonjour, nous sommes navrés que vous n'ayez pas pu joindre le service Visa premier. 
Vous pouvez contacter le centre de relation client au 0810 24 68 10, disponible jusqu'à 22 heures en semaine qui vous pourra vous transférer au service.
Bonne soirée. MM.

@benoitvialle Bonjour Benoit, nous sommes navrés de votre insatisfaction. 
Afin de pouvoir vous aider, pouvez-vous nous indiquer, en message privé, votre nom complet, code postal, ainsi que le type de document demandé à votre conseiller ?
Merci. MM. [LIEN]

@LuizOctavioVil1 Nous vous remercions pour ces précisions. 
Pouvez-vous nous confirmer que les documents transmis sont en PDF, s'il vous plait ? Est-ce que les documents sont flous ou coupés ? Pouvez-vous nous préciser la taille de ces derniers ? 
Nous restons à votre disposition. EC
